def MedianFilter(raw_data, window_size):
    new_data = 0 * raw_data.copy()
    for i in range(raw_data.size - window_size):
        window_data = raw_data[i : i + window_size]
        window_data_sort = sorted(window_data)
        index_midian = window_size / 2
        Median_Value = window_data_sort[index_midian]
        for j in range(window_size):
            new_data[i + j] = Median_Value
    return new_data

def regul(signal_data):
    signal_data_mean = signal_data.mean()
    signal_data_r = signal_data - signal_data_mean
    return signal_data_r


